Pontus Lindqvist, born in 1986, was one of Sweden's foremost boy sopranos. He joined the Oscar Children's Choir at the age of six, later joining the Oscar Boys's Choir. He lived in England for a year and had the opportunity to take part in the boy choir tradition in the Cambridgeshire Boys' Choir. 
Pontus also sang in the Adolf Frederik Boys' Choir and often appeared as a soloist in the Oskar Church.


